description:
Webshots Widescreen High Resolution 2560 x 1600 Photo Album

Webshots is a photo sharing web site. They have also released a nice screensaver that allows users to download or import their own photos to be used in the screensaver. Unfortunately, they do not allow free downloads of widescreen photos. So here is my contribution!

Here are 128 nature &amp; city scenes (128 is the maximum number of photos allowed per album in Webshots).

This archive contains 3 files:

WebshotsWidescreen.rar: (the full size JPG files, in case you want to use the photos in another application) 209Mb.

album-19999.rar: (Contains the proprietary format for the Webshots program. Simply extract this file to your Webshots Data directory found in the current user?s My Documents) 54Mb.

DiStInCt.nfo: (this iNFOrmation file).

